import React from 'react';

class Home extends React.Component {
    render() {
        return (
            <article className="home">
                <div>
                <h2>Om mig</h2>
                </div>

                    <p>
                    Mitt namn är Johan Ledel, 27år gammal. Bor I halmstad och läser Webbprogrammering på BTH på Distans
                    sedan hösten 2018.
                </p>
                <p>
                    När jag inte studerar eller arbetar på Clas Ohlson spenderar jag mycket tid på golfbanan. Mycket av min tid och planering
                    av gym träning går till att förbättra min golf även om det bara är på en hobby nivå.
                </p>
            </article>
        )
    }
}

export default Home;
